import React from "react";

const Home = () => {
  const [login, setlogin] = React.useState(false);
  const loginHandel = () => {
    setlogin(true);
  };
  return (
    <div>
      welcome to home !<button onClick={loginHandel.bind(this)}>login</button>
    </div>
  );
};
export default Home;
